description:
High-quality, small-size PDFs of all the P90X3 workout calendars, including:

- Classic
- Doubles
- Lean
- Mass
- Elite Block

These workout calendars are a revision to the workout calendars (&quot;landscape&quot; version) that can be found here:  &lt;a href=&quot;
http://thepiratebay.se/torrent/9520641&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://thepiratebay.se/torrent/9520641&lt;/a&gt;

The calendars in this torrent are in &quot;portrait&quot; orientation and are more consistent with the format of the official P90X3 worksheets, which may be found here:  &lt;a href=&quot;
http://www.beachbody.com/text/us/products/programs/p90x3/P90X3_Worksheets.pdf&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.beachbody.com/text/us/products/programs/p90x3/P90X3_Worksheets.pdf&lt;/a&gt;

There are two versions in this torrent: one in which the Elite Block is separate from the other blocks, and one in which the Elite Block is combined with the other blocks on one sheet (see thumbnails below).

